import axios from "axios"
export default{
    fetchproducts({success, fail,data})
{
    axios.get(`https://www.blibli.com/backend/search/products?searchTerm=${data}&start=0&itemPerPage=24`)
        .then(
            (data)=>
            {
                success(data)
            })
        .catch((error) => {
            fail(error)
        })
    }
}
